return(
<div>
    <Jumbotron>
    <div className = ""> 
        <h1 >{title}</h1>
        <p className = "lead">  {discreption}</p>
    </div>

    </Jumbotron>
    <div className = {className}>{children}</div>
</div>
);
    
};
export default Layout;
